import './Home.css'
import marela from '../Assets/marela.jpeg';
import title from '../Assets/name.svg'
import NavMenu from '../NavMenu/NavMenu';

interface Props {
    text: string;
}

export default function Home(props: Props){
    return(
        <>
            <div className="root">
                <div className="menu">
                    <NavMenu/>
                </div>
                <div className="title">
                    <img src={title}/>
                </div>
                <div className="image">
                    <img src={marela}/>
                </div>
                <div className="about">
                    {props.text}
                </div>
            </div>
        </>
    );
}
